      rescue brittanyspaniel brittany\" latitude=\"0\" longitude=\"0\" accuracy=\"0\"
      context=\"0\" media=\"photo\" media_status=\"ready\" url_sq=\"https://live.staticflickr.com/65535/53683422277_1a26cb53b3_s.jpg\"
