      height_s=\"160\" width_s=\"240\" url_m=\"https://live.staticflickr.com/65535/53683422277_1a26cb53b3.jpg\"
      height_m=\"333\" width_m=\"500\" url_q=\"https://live.staticflickr.com/65535/53683422277_1a26cb53b3_q.jpg\"
      height_q=\"150\" width_q=\"150\" url_l=\"https://live.staticflickr.com/65535/53683422277_1a26cb53b3_b.jpg\"
      height_l=\"681\" width_l=\"1024\" pathalias=\"\" is_primary=\"0\" has_comment=\"0\">\n\t\t<description>This
      has been our first full week with Sir Fredrick the Magnificent. And it has been
      great.  He is quite the charmer and cuddler.  Plus he&#039;s doing well on the
      (almost) sleeping through the night thing.  Plus he still makes those little
      puppy grunting sounds when he&#039;s tired. Us humans are in love.\n\nEva and
      Agnes are transitioning from ignoring to accepting.  Or at least they will let
      him on the same dog bed with them.  </description>\n\t</photo>\n\t<photo id=\"53680296288\"
      owner=\"48996974@N08\" secret=\"e0b445a87c\" server=\"65535\" farm=\"66\" title=\"Trusting
      his cape, the 5th little gosling takes his leap of faith\" ispublic=\"1\" isfriend=\"0\"
      isfamily=\"0\" license=\"0\" safety_level=\"0\" dateupload=\"1714140405\" datetaken=\"2024-04-23
      12:50:23\" datetakengranularity=\"0\" datetakenunknown=\"0\" ownername=\"\u265EJenny\u265E\"
      count_views=\"862\" count_comments=\"70\" tags=\"canadagoslingjumpingoffroof\"
      latitude=\"0\" longitude=\"0\" accuracy=\"0\" context=\"0\" media=\"photo\"
      media_status=\"ready\" url_sq=\"https://live.staticflickr.com/65535/53680296288_e0b445a87c_s.jpg\"
      height_sq=\"75\" width_sq=\"75\" url_t=\"https://live.staticflickr.com/65535/53680296288_e0b445a87c_t.jpg\"
      height_t=\"63\" width_t=\"100\" url_s=\"https://live.staticflickr.com/65535/53680296288_e0b445a87c_m.jpg\"
      height_s=\"151\" width_s=\"240\" url_m=\"https://live.staticflickr.com/65535/53680296288_e0b445a87c.jpg\"
      height_m=\"315\" width_m=\"500\" url_q=\"https://live.staticflickr.com/65535/53680296288_e0b445a87c_q.jpg\"
      height_q=\"150\" width_q=\"150\" url_l=\"https://live.staticflickr.com/65535/53680296288_e0b445a87c_b.jpg\"
      height_l=\"645\" width_l=\"1024\" pathalias=\"bereal4ever\" is_primary=\"0\"
      has_comment=\"0\">\n\t\t<description>So here we see the 5th little gosling making
      his jump off the roof of my barn to join his 4 siblings and his parents.\n\nAll
      5 little ones made it down without any adverse results and they all left and
      went about their merry way.\n\nThanks for following this little wondrous journey
      with me here my good flickr friends.\n\nI am, again, posting a link to a song
      James Page referred me to that is so perfect for my shots of all these little
      ones taking the leap of faith and beginning their new lives here on earth.\n\n&lt;a
      href=&quot;https://www.youtube.com/watch?v=T6bZ37nexSY&quot; rel=&quot;noreferrer
      nofollow&quot;&gt;www.youtube.com/watch?v=T6bZ37nexSY&lt;/a&gt;\n\nI love the
      words, &amp;quot;Spread your arms and hold your breath and always trust your
      cape&amp;quot;. Take a listen to the song if you didn&#039;t see the link yesterday.
      \ It&#039;s worth the listen.\n\nLet&#039;s hope they have long and healthy
      lives and go on to have their own sets of little Canada goslings to bring into
      this world, crazy as it is.\n\nAnd as a side note, I don&#039;t know how anyone
      could view these photos in this series and not gain an even deeper love and
      appreciation for what we have in our natural world and environment. These tiny
      little goslings, jumping off the roof like this just amazes me. That their drive
      for survival is so strong as to allow them to do this after having hatched just
      24 hours earlier.  How marvelous is that!</description>\n\t</photo>\n\t<photo
